The main purpose of collecting information is to provide you with a smart, smooth, efficient and awesome user experience and to provide you with Services and features that better meet your needs or requests. We may collect information about your personal and non-personal information as follows: 
1. Personal Information You Provide to Us: 
Your username, password and e-mail address when you register for a C Launcher account; 
Your phone status and device identifier when you need to call; 
List of your contacts and related data; 
Content of instant messaging communications, voice messages, and video messages; 
Your camera and album when you need to take pictures and videos; 
Location information, derived from your mobile carrier or from the mobile device that you use; 
Access tokens for third-party accounts you associate with your C Launcher account (such as Facebook), which are used to share your themes to friends. 
The web search services provided herein are provided by third parties. For further information on data collection please visit the search providerâ€™s privacy policy, as applicable. 
2. Non-Personal Information Collected Automatically: 
We collect non-personal information about your use of our Apps and aggregated information regarding the usages of the Apps. Non-Personal Information means information that is of an anonymous nature, such as the type of mobile device you use, your mobile devices unique device ID, the IP address of your mobile device, your mobile operating system, and information about the way you use the Applications.
